<template>
  <div class="section-sticky">
    <div class="content" id="top" :class="{higherTop: hasSecondTab}">
      <div class="banner">
        <p>乡村振兴</p>
      </div>
      <van-sticky>
        <div class="header" :class="{secondTab: hasSecondTab}">
          <div v-for="(item, index) in tabListShow" v-if="tabRowShow===0" class="tab-item" :class="{tabActive: index===tabActiveIndex}" @click="changeShow(index)">
            <span>{{item}}</span>
            <div v-if="index===tabActiveIndex" class="active-line"></div>
          </div>
          <div v-for="(item, index) in tabListShow" v-if="tabRowShow===1" class="tab-item" :class="{tabActive: index===tabActiveIndex-5}" @click="changeShow(index+5)">
            <span>{{item}}</span>
            <div v-if="index===tabActiveIndex-5" class="active-line"></div>
          </div>
          <van-dropdown-menu>
            <van-dropdown-item title="" ref="item" v-model="tabActiveIndex" :options="tabListText" @change="changeShow">
            </van-dropdown-item>
          </van-dropdown-menu>
          <div class="sub-tab-scroll">
            <div v-if="hasSecondTab" class="sub-tab">
              <div
                v-for="(item,index) in subTabList"
                class="sub-tab-item"
                :class="{subActive: index===subTabActiveIndex}"
                @click="changeSubTab(index)">{{item}}</div>
            </div>
          </div>
        </div>
      </van-sticky>
      <div class="clear-both"></div>
      <div class="tab-content">
        <preschool-education v-if="tabActiveIndex===0" :Poverty="Poverty"></preschool-education>
        <compulsory-education v-if="tabActiveIndex===1" :Poverty="Poverty"></compulsory-education>
        <high-school-education v-if="tabActiveIndex===2" :Poverty="Poverty"></high-school-education>
        <presonnel1 v-if="tabActiveIndex===3" :Poverty="Poverty"></presonnel1>
        <infrastructure v-if="tabActiveIndex===4" :Poverty="Poverty"></infrastructure>
        <Ecologically v-if="tabActiveIndex===5" :Poverty="Poverty"></Ecologically>
        <Ruralcivilization v-if="tabActiveIndex===6" :Poverty="Poverty"></Ruralcivilization>
        <Ruralgovernance v-if="tabActiveIndex===7" :Poverty="Poverty"></Ruralgovernance>
      </div>
    </div>
  </div>
</template>

<script>
  import PreschoolEducation from "./Poverty-alleviation";
  import CompulsoryEducation from "./compulsory-education";
  import HighSchoolEducation from "./public-service";
  import presonnel1 from  "./personnel"
  import  infrastructure from  "./infrastructure"
  import  Ecologically from "./Ecologically-livable"
  import  Ruralcivilization from  "./Rural-civilization"
  import  Ruralgovernance from  "./Rural-governance"
  import {ruralRevitalization} from "./api/api"
  import {remToPx} from '../../libs/util'
  export default {
    name: "index",
    components:
      {
        CompulsoryEducation,
        PreschoolEducation,
        HighSchoolEducation,
        presonnel1,infrastructure,
        Ecologically,
        Ruralcivilization,
        Ruralgovernance},
    data() {
      return {
        // 是否有二级tab页
        hasSecondTab: false,
        tabListText: [
          { text: '脱贫攻坚', value: 0 },
          { text: '产业振兴', value: 1 },
          { text: '公共服务', value: 2 },
          { text: '人才振兴', value: 3 },
          { text: '基础设施', value: 4 },
          { text: '生态宜居', value: 5 },
          { text: '乡村文明', value: 6 },
          { text: '乡村治理', value: 7 },
          // { text: '生态宜居', value: 8 },
        ],
        // 当前显示的tab页
        tabListShow: [],
        // 当前显示的tab页是第几行
        tabRowShow: '',
        tabActiveIndex: '',
        subTabList: [],
        subTabActiveIndex: '',


        Poverty:[],
        //脱贫攻坚
        Povertydata:[],
        //产业振兴
        industrydata:[],
        //公共服务
        publicdata:[],
        //人才振兴
        presonneldata:[],
        //基础设施
        infrastdata:[],
        //生态宜居
        Ecologdata:[],
        //乡风文明
        Ruralcivildata:[],
        //乡村治理
        ruralGoverdata:[],
      }
    },
    mounted() {
      this.initWin();
      // this.test();
      this.initDOM();
      this.tabActiveIndex = 0;
      this.subTabActiveIndex = 0;

    },
    methods: {
      initWin() {
        ruralRevitalization({
          type: ""
        }).then((res) => {
          if (!res.data.status) return false;
          let data = res.data.data;
          this.Poverty = data.povertyAlleviation;
          this.Povertydata  = this.Poverty
          this.industrydata = data.industryRevitalization;
          this.publicdata = data.publicService
          this.presonneldata =data.talentRevitalization
          this.infrastdata = data.infrastructure
          this.Ecologdata=data.ecologicallyLivable
          this.Ruralcivildata = data.ruralCivilization
          this.ruralGoverdata = data.ruralGovernance
          this.changeShow(0)
        });
      },
      initDOM() {
        document.getElementById("top").scrollIntoView(true);
        this.tabRowShow = 0;
        // 初始显示前5个tab页
        this.sliceObject(this.tabListText, 0, 4);
      },
      // 切换tab页时针对每个tab页不同的处理
      changeTab(index) {
        this.tabActiveIndex = index;
        document.getElementById("top").scrollIntoView(true);
        if (this.tabActiveIndex === 0) { //脱贫攻坚
          this.hasSecondTab = true;
          this.Poverty  = this.Povertydata
          this.subTabList = ['脱贫地区', '人均收入','危房改造','集中供水','义务教育','集体经济','产业园区','电子商务'];
        } else if (this.tabActiveIndex === 1) { //产业振兴
          this.hasSecondTab = false;
          this.Poverty  = this.industrydata
        } else if (this.tabActiveIndex === 2) { //公共服务
          this.hasSecondTab = true;
          this.Poverty = this.publicdata ;
          this.subTabList = ['养老机构','儿童教育','社会救助','教育','医疗'];
        } else if (this.tabActiveIndex === 3) {//人才振兴
          this.hasSecondTab = true;
          this.Poverty = this.presonneldata;
          this.subTabList = ['新型职业农民','大学生就业','农业高层次人才引进'];
        }else if (this.tabActiveIndex === 4) { //基础设施
          this.hasSecondTab = true;
          this.subTabList = ['农业基础设施','交通基础设施','生活基础设施'];
          this.Poverty = this.infrastdata;
        }else if (this.tabActiveIndex === 5) {  //生态宜居
          this.hasSecondTab = false;
          this.Poverty = this.Ecologdata;
        }else if (this.tabActiveIndex === 6) {
          this.hasSecondTab = true;
          this.Poverty = this.Ruralcivildata;
          this.subTabList = ['思想道德建设','侨乡特色文化','乡村文化生活'];
        }else{
          this.hasSecondTab = false;
          this.Poverty = this.ruralGoverdata;
        }
      },
      // 点击Tab页
      changeShow(value) {

        // document.getElementById("top").scrollIntoView(true);
        this.tabListShow = [];
        this.subTabActiveIndex = this.subTabActiveIndex >=0 ? 0 : this.subTabActiveIndex;
        // 先进行判断当前点击的是在第一行还是在第二行
        if (value > 4) {
          this.tabRowShow = 1;
          this.sliceObject(this.tabListText, 5, this.tabListText.length-1);

        } else {
          this.tabRowShow = 0;
          this.sliceObject(this.tabListText, 0, 4);
        }
        this.changeTab(value);
      },
      // 通过传递的参数，确定当前显示的tab页是哪一部分
      sliceObject(obj, min, max) {
        obj.forEach((item, index) => {
          if (index >= min && index <= max) {
            this.tabListShow.push(item.text);
          }
        })
      },
      // 点击二级菜单的动作
      changeSubTab(index) {
        this.subTabActiveIndex = index;
        if (index === 0) {
          document.getElementById("top").scrollIntoView(true);
        }else if (index === 1) {

          const secondTab = document.getElementById("secondTab");
          let offset = secondTab.offsetTop;
          this.$nextTick(() => {
            window.scrollTo({
              behavior: 'smooth',
              top: offset - remToPx(220/75)
            });
          })
        } else{

          const secondTab = document.getElementById("secondTab"+index);
          let offset = secondTab.offsetTop;
          this.$nextTick(() => {
            window.scrollTo({
              behavior: 'smooth',
              top: offset - remToPx(220/75)
            });
          })
        }
      }
    }
  }
</script>

